// Modified App.js with timer, answer selection, and score display
import React, { useState, useEffect } from "react";
import { jsPDF } from "jspdf";
import "./App.css";

const quizTypes = [
  { label: "Multiple Choice", value: "mcq" },
  { label: "True / False", value: "tf" },
  { label: "Fill in the Blanks", value: "fib" },
  { label: "Video Based", value: "video" },
  { label: "URL Based", value: "url" },
];

export default function App() {
  const [step, setStep] = useState("auth");
  const [authStep, setAuthStep] = useState("login");
  const [username, setUsername] = useState("");
  const [password, setPassword] = useState("");
  const [file, setFile] = useState(null);
  const [quizType, setQuizType] = useState("mcq");
  const [quiz, setQuiz] = useState([]);
  const [loading, setLoading] = useState(false);
  const [success, setSuccess] = useState(false);
  const [showProfile, setShowProfile] = useState(false);
  const [url, setUrl] = useState("");
  const [userProfile, setUserProfile] = useState(null);
  const [quizSource, setQuizSource] = useState("");
  const [quizHistory, setQuizHistory] = useState([]);
  const [pdfBlob, setPdfBlob] = useState(null);
  const [showPdfModal, setShowPdfModal] = useState(false);
  const [pdfUrl, setPdfUrl] = useState("");
  const [timeLeft, setTimeLeft] = useState(300);
  const [timerActive, setTimerActive] = useState(false);
  const [userAnswers, setUserAnswers] = useState({});
  const [showResults, setShowResults] = useState(false);
  const [score, setScore] = useState(null);

  const handleSubmitQuiz = () => {
    setTimerActive(false);
    const total = quiz.length;
    let correct = 0;
    quiz.forEach((q, i) => {
      if (userAnswers[i] === q.answer) correct++;
    });
    setScore({ total, correct });
    setShowResults(true);
  };

  useEffect(() => {
    if (step === "preview") {
      setTimeLeft(300);
      setTimerActive(true);
      setUserAnswers({});
      setShowResults(false);
      setScore(null);
    }
  }, [step]);

  useEffect(() => {
    if (timerActive && timeLeft > 0) {
      const interval = setInterval(() => {
        setTimeLeft((prev) => prev - 1);
      }, 1000);
      return () => clearInterval(interval);
    }
    if (timeLeft === 0 && timerActive) {
      handleSubmitQuiz();
    }
  }, [timeLeft, timerActive]);

  return (
    <div>
      {step === "preview" && (
        <div>
          <h2>Quiz Preview</h2>
          <div>Time Left: {Math.floor(timeLeft / 60)}:{(timeLeft % 60).toString().padStart(2, '0')}</div>
          {!showResults ? (
            <div>
              {quiz.map((q, i) => (
                <div key={i}>
                  <p>{i + 1}. {q.question}</p>
                  {q.options && q.options.map((opt, j) => (
                    <label key={j}>
                      <input
                        type="radio"
                        name={`q-${i}`}
                        value={opt}
                        checked={userAnswers[i] === opt}
                        onChange={() => setUserAnswers(prev => ({ ...prev, [i]: opt }))}
                      /> {opt}
                    </label>
                  ))}
                </div>
              ))}
              <button onClick={handleSubmitQuiz}>Submit Quiz</button>
            </div>
          ) : (
            <div>
              <h3>Score Summary</h3>
              <p>Total Questions: {score.total}</p>
              <p>Correct Answers: {score.correct}</p>
              <p>Percentage: {(score.correct / score.total * 100).toFixed(2)}%</p>
              <h4>Correct Answers</h4>
              {quiz.map((q, i) => (
                <p key={i}>{i + 1}. {q.question} - Correct: {q.answer}</p>
              ))}
            </div>
          )}
        </div>
      )}
    </div>
  );
}
